import React from 'react';
import logo from '../assets/logo.png';

const AdminNavBar = ({ setCurrentView }) => {
  return (
    <div className="flex flex-col md:flex-row justify-between items-center h-auto max-w-auto px-6 py-4 bg-white text-black relative z-50 shadow-lg">
      {/* Logo Section */}
      <div className="flex items-center justify-start w-full md:w-auto mb-4 md:mb-0">
        <img
          src={logo}
          alt="admin-logo"
          className="h-14 w-14 cursor-pointer transform transition duration-300 hover:scale-110"
        />
      </div>

      {/* Buttons Section */}
      <div className="flex justify-center items-center w-full space-x-4">
        <button
          onClick={() => setCurrentView('home')}
          className="bg-gradient-to-r from-blue-500 via-blue-600 to-blue-700 text-white rounded-full px-6 py-3 font-medium transform transition-all duration-300 hover:scale-105 hover:shadow-lg"
        >
          Admin Panel
        </button>
        <button
          onClick={() => setCurrentView('courses')}
          className="bg-gradient-to-r from-green-500 via-green-600 to-green-700 text-white rounded-full px-6 py-3 font-medium transform transition-all duration-300 hover:scale-105 hover:shadow-lg"
        >
          Courses Data
        </button>
        <button
          onClick={() => alert('Button 2 Functionality - Coming Soon!')}
          className="bg-gradient-to-r from-yellow-500 via-yellow-600 to-yellow-700 text-white rounded-full px-6 py-3 font-medium transform transition-all duration-300 hover:scale-105 hover:shadow-lg"
        >
          Students Data
        </button>
        <button
          onClick={() => setCurrentView('enquiries')}
          className="bg-gradient-to-r from-red-500 via-red-600 to-red-700 text-white rounded-full px-6 py-3 font-medium transform transition-all duration-300 hover:scale-105 hover:shadow-lg"
        >
          Enquiry Data
        </button>
      </div>
    </div>
  );
};

export default AdminNavBar;
